import React from "react";

const Navbar = () => {
  return (
    <div className="h-screen w-[250px] bg-yellow text-white">
      <div className="h-[120px] w-full flex items-center justify-center">
        <h1 className="text-4xl  font-bold cursor-pointer">
          SCORE<span className="text-black">Info</span>
        </h1>
      </div>
      <div className="h-[250px] w-full  text-xl ">
        <li className="cursor-pointer">World Cup</li>
        <li className="cursor-pointer">Leagues</li>

        <li className="cursor-pointer">Transfers</li>
      </div>
    </div>
  );
};

export default Navbar;
